import React, { Component } from 'react';
import {BrowserRouter as Router, NavLink}        from 'react-router-dom'; 

import '../../assets/css/home/navigationBar.css';

class NavigationBar extends Component {
    render() {
        return (
                <nav className="navbar navbar-expand-md" style={{ marginBottom: 6 + "px", backgroundColor: 'White' }}>
                    <Link to="/">
                        <img style={{ width: 45 + "px", height: 45 + "px" }}
                            src={require('../../assets/images/jazz_logo.png')}
                            alt=" " />
                    </Link>

                    <button className="navbar-toggler"
                        type="button"
                        data-toggle="collapse"
                        data-target="#navbarcontent"
                        area-controls="navbarcontent"
                        area-expanded="false"
                        area-label="Toggle Navigation">

                        <span className="navbar-toggler-icon"></span>
                    </button>

                    <div className="collapse navbar-collapse" id="navbarcontent" >

                        <ul className="navbar-nav mr-auto">

                            <li className="nav-item active">
                                <NavLink className="nav-link li-class-top-home-nav-feeds" 
                                             to="/"> Feeds
                                      <span className="sr-only">(current)</span>
                                </NavLink>
                            </li>

                            <li className="nav-item">
                                <NavLink className="nav-link li-class-top-home-nav" 
                                             to="/series">Series
                                </NavLink>
                            </li>

                            <li className="nav-item">
                                <NavLink className="nav-link li-class-top-home-nav" 
                                             to="/videos">Videos
                                </NavLink>
                            </li>

                            <li className="nav-item">
                                <NavLink className="nav-link li-class-top-home-nav" 
                                             to="/stories">Stories
                                </NavLink>
                            </li>

                            <li className="nav-item">
                                <NavLink className="nav-link li-class-top-home-nav" 
                                             to="/ranking">Rankings
                                </NavLink>
                            </li>
                        </ul>
                    </div>


                <Router path="/"         component={Home} />
                <Router path="/series"   component={Series}/>
                <Router path="/videos"   component={Videos}/>
                <Router path="/stories"  component={Stories}/>
                <Router  path="/ranking" component={Ranking}/>


                </nav>


        );
    }
}

function Home(){
    return(
        <div>
            Home
        </div>
    )
}

function Series(){
    return(
        <div>
            Series
        </div>
    )
}
function Videos(){
    return(
        <div>
            Series
        </div>
    )
}

function Stories(){
    return(
        <div>
            Series
        </div>
    )
}
function Ranking(){
    return(
        <div>
            Series
        </div>
    )
}


export default NavigationBar;
